import React from "react"
import Testimonial from './Testimonial.js';
import kenny from "./kenny-chi.jpeg";
import iris from "./iris-dong.jpeg";
import person from "./person.png"
export default function SellerPage(props) {
    let pages = [
        {name:'Kenny', text: 'Hi everyone, my name is Kenny Chi and I\'m a second year CS student at UC Berkeley.', image: person, align: 'left'},
        {name: 'Iris', text: 'Hi everyone, my name is Iris Dong and I\'m a second year ECE student at Carnegie Mellon University.', image: person, align: 'right'},
    ]
    return (
        <center className = 'aboutus'>
            <h1>Home Depot</h1>
            {pages.map((items) =>
                <Testimonial className = 'testimonial' align={items.align} name={items.name} text={items.text} image={items.image} size={{width: "1000px", height: "200px"}}/>
            )}
        </center>
    )
}
